import { Link } from "react-router-dom";

const navLinks = [
    { path: "/", label: "Accueil" },
    { path: "/actualites", label: "Actualités" },
    { path: "/etat-civil", label: "État Civil" },
    { path: "/demarches", label: "Démarches" },
    { path: "/fiches-pratiques", label: "Fiches Pratiques" },
    { path: "/etranger", label: "Étranger" }
];

export default function Navbar() {
    return (
        <nav className="bg-white border-b px-6 py-3 flex flex-wrap gap-3 justify-center">
            {navLinks.map((link) => (
                <Link key={link.path} to={link.path} className="px-5 py-3 rounded-md text-md font-medium hover:bg-gray-100">
                    {link.label}
                </Link>
            ))}
        </nav>
    );
}
